contract Ex2_10 {

    function fun1() public pure returns(uint) {
        uint result = 0;
        for(uint a = 0; a<2; a++){
            for(uint b = 2; b<4; b++){
                result = result + (a*b);
            }
        }

        return result;
    }

}

